import { Component } from '@angular/core';
import { RouterOutlet } from '@angular/router';
import { ImageComponent } from './components/image/image.component';
import { TextComponent } from './components/text/text.component';
import { ProductComponent } from './components/product/product.component';
import { CdkDragDrop, CdkDropList, CdkDrag, moveItemInArray } from '@angular/cdk/drag-drop';
import { NgClass } from '@angular/common';

export type types = 'image' | 'text' | 'product';

export type Product = { text: string, url: string, type: types };
export type Text = { text: string, type: types };
export type Image = { text: string, url: string, type: types };

@Component({
  selector: 'app-root',
  standalone: true,
  imports: [
    RouterOutlet,
    ImageComponent,
    TextComponent,
    ProductComponent,
    CdkDropList, CdkDrag, NgClass
  ],
  templateUrl: './app.component.html',
  styleUrl: './app.component.scss'
})
export class AppComponent {
  title = 'ng-drug-n-drop';

  public elements: any [] = [];

  constructor() {
    this.elements = [
      {
        text: 'Create a new workspace and an initial application\n' +
          '\n' +
          'You develop applications in the context of an Angular workspace. A workspace contains the files for one or more projects. A project is the set of files that make up an application or a library.\n' +
          '\n' +
          'To create a new workspace and an initial project:',
        type: 'text'
      },
      {
        text: 'Хамелиончик за 3 тыщи',
        type: 'product',
        url: 'data:image/jpeg;base64,'
      }, {
        text: 'Дерево за 2 тыщи',
        type: 'product',
        url: 'data:image/jpeg;base64,'
      }, {
        text: 'Лист за 10 тыщь',
        type: 'product',
        url: 'data:image/jpeg;base64,'
      },
      {
        text: 'картинка 1',
        type: 'image',
        url: 'data:image/jpeg;base64,'
      },
      {
        text: 'ng new also creates the following workspace and starter project files:\n' +
          '\n' +
          '    A new workspace, with a root directory named angular-tour-of-heroes\n' +
          '    An initial skeleton application project in the src/app subdirectory\n' +
          '    Related configuration files\n' +
          '\n',
        type: 'text',
      },
      {
        text: 'Перо бесценно',
        type: 'product',
        url: 'data:image/jpeg;base64,'
      },
      {
        text: 'картинка 2',
        type: 'image',
        url: 'data:image/jpeg;base64,'
      }

    ];
  }

  drop(event: CdkDragDrop<string[]>) {
    moveItemInArray(this.elements, event.previousIndex, event.currentIndex);
  }

  public isDruggable = false;

  public toggle() {
    this.isDruggable = !this.isDruggable;
  }
}
